#
# This Trie approach works for the problem. I originally tried a set based approach.
# That works as well.
#
from typing import List
from collections import defaultdict

class TrieNode():
    def __init__(self):
        self.children = defaultdict()
        self.end = False

class Solution:
    def longestCommonPrefix(self, arr1: List[int], arr2: List[int]) -> int:
        def dfs(node1, node2):
            if len(node1.children) == 0 or len(node2.children) == 0:
                return 0
            tmp = 0
            for ch in node1.children:
                if ch in node2.children:
                    tmp = max(tmp, 1 + dfs(node1.children[ch], node2.children[ch]))
            return tmp
        def createTrie(arr):
            root = TrieNode()
            for i in arr:
                s = str(i)
                curr = root
                for d in s:
                    if d not in curr.children:
                        curr.children[d] = TrieNode()
                    curr = curr.children[d]
                curr.end = True
            return root
        root1 = createTrie(arr1)
        root2 = createTrie(arr2)
        res = 0
        return dfs(root1, root2)

